import React, { Component } from "react";
import headshot from "../photos/headshotSmaller.png";

class Nameintro extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "300 300",
          gridTemplateRows: "70px 70px 650px",
        }}
        id="nameIntro"
      >
        <div
          style={{
            fontFamily: "Unna",
            fontStyle: "italic",
            fontSize: 120,
            gridRow: "1/2",
          }}
        >
          vivan &nbsp;
        </div>
        <div
          style={{
            fontFamily: "Unna",
            fontWeight: "bold",
            fontSize: 120,
            gridRow: "2/3",
          }}
        >
          marwaha
        </div>
        <div
          style={{
            position: "relative",
            fontFamily: "Unna",
            fontStyle: "italic",
            gridColumn: "1/2",
            gridRow: "3/4",
          }}
        >
          Writer, philanthropist,
          <br /> and more. The invisible <br />
          social power of technology. <br />
        </div>
        <img
          src={headshot}
          alt="Image of vivan"
          style={{
            width: 480,
            height: 400,
            gridColumn: "2/3",
            gridRow: "3/4",
          }}
        />
      </div>
    );
  }
}

export default Nameintro;
